protected Object constructAttribute(Constructor<?> ctor, String attributeName, MethodParameter parameter,
		WebDataBinderFactory binderFactory, NativeWebRequest webRequest) throws Exception {

	if (ctor.getParameterCount() == 0) {
		// A single default constructor -> clearly a standard JavaBeans arrangement.
		return BeanUtils.instantiateClass(ctor);
	}

	// A single data class constructor -> resolve constructor arguments from request parameters.
	String[] paramNames = BeanUtils.getParameterNames(ctor);
	Class<?>[] paramTypes = ctor.getParameterTypes();
	Object[] args = new Object[paramTypes.length];
	WebDataBinder binder = binderFactory.createBinder(webRequest, null, attributeName);
	String fieldDefaultPrefix = binder.getFieldDefaultPrefix();
	String fieldMarkerPrefix = binder.getFieldMarkerPrefix();
	boolean bindingFailure = false;
	Set<String> failedParams = new HashSet<>(4);

	for (int i = 0; i < paramNames.length; i++) {
		String paramName = paramNames[i];
		Class<?> paramType = paramTypes[i];
		Object value = webRequest.getParameterValues(paramName);

		// Since WebRequest#getParameter exposes a single-value parameter as an array
		// with a single element, we unwrap the single value in such cases, analogous
		// to WebExchangeDataBinder.addBindValue(Map<String, Object>, String, List<?>).
		if (ObjectUtils.isArray(value) && Array.getLength(value) == 1) {
			value = Array.get(value, 0);
		}

		if (value == null) {
			if (fieldDefaultPrefix != null) {
				value = webRequest.getParameter(fieldDefaultPrefix + paramName);
			}
			if (value == null) {
				if (fieldMarkerPrefix != null && webRequest.getParameter(fieldMarkerPrefix + paramName) != null) {
					value = binder.getEmptyValue(paramType);
				}
				else {
					value = resolveConstructorArgument(paramName, paramType, webRequest);
				}
			}
		}

		try {
			MethodParameter methodParam = new FieldAwareConstructorParameter(ctor, i, paramName);
			if (value == null && methodParam.isOptional()) {
				args[i] = (methodParam.getParameterType() == Optional.class ? Optional.empty() : null);
			}
			else {
				args[i] = binder.convertIfNecessary(value, paramType, methodParam);
			}
		}
		catch (TypeMismatchException ex) {
			ex.initPropertyName(paramName);
			args[i] = null;
			failedParams.add(paramName);
			binder.getBindingResult().recordFieldValue(paramName, paramType, value);
			binder.getBindingErrorProcessor().processPropertyAccessException(ex, binder.getBindingResult());
			bindingFailure = true;
		}
	}

	if (bindingFailure) {
		BindingResult result = binder.getBindingResult();
		for (int i = 0; i < paramNames.length; i++) {
			String paramName = paramNames[i];
			if (!failedParams.contains(paramName)) {
				Object value = args[i];
				result.recordFieldValue(paramName, paramTypes[i], value);
				validateValueIfApplicable(binder, parameter, ctor.getDeclaringClass(), paramName, value);
			}
		}
		if (!parameter.isOptional()) {
			try {
				Object target = BeanUtils.instantiateClass(ctor, args);
				throw new MethodArgumentNotValidException(parameter, result) {
					@Override
					public Object getTarget() {
						return target;
					}
				};
			}
			catch (BeanInstantiationException ex) {
				// swallow and proceed without target instance
			}
		}
		throw new MethodArgumentNotValidException(parameter, result);
	}

	try {
		return BeanUtils.instantiateClass(ctor, args);
	}
	catch (BeanInstantiationException ex) {
		if (KotlinDetector.isKotlinType(ctor.getDeclaringClass()) &&
				ex.getCause() instanceof NullPointerException cause) {
			BindingResult result = binder.getBindingResult();
			ObjectError error = new ObjectError(ctor.getName(), cause.getMessage());
			result.addError(error);
			throw new MethodArgumentNotValidException(parameter, result);
		}
		else {
			throw ex;
		}
	}
}

protected Object createAttribute(String attributeName, MethodParameter parameter,
		WebDataBinderFactory binderFactory, NativeWebRequest webRequest) throws Exception {

	MethodParameter nestedParameter = parameter.nestedIfOptional();
	Class<?> clazz = nestedParameter.getNestedParameterType();

	Constructor<?> ctor = BeanUtils.getResolvableConstructor(clazz);
	Object attribute = constructAttribute(ctor, attributeName, parameter, binderFactory, webRequest);
	if (parameter != nestedParameter) {
		attribute = Optional.of(attribute);
	}
	return attribute;
}

public static MethodValidator from(
		@Nullable WebBindingInitializer initializer, @Nullable ParameterNameDiscoverer paramNameDiscoverer,
		Predicate<MethodParameter> modelAttributePredicate, Predicate<MethodParameter> requestParamPredicate) {

	if (initializer instanceof ConfigurableWebBindingInitializer configurableInitializer) {
		Validator validator = getValidator(configurableInitializer);
		if (validator != null) {
			MethodValidationAdapter adapter = new MethodValidationAdapter(validator);
			adapter.setObjectNameResolver(objectNameResolver);
			if (paramNameDiscoverer != null) {
				adapter.setParameterNameDiscoverer(paramNameDiscoverer);
			}
			MessageCodesResolver codesResolver = configurableInitializer.getMessageCodesResolver();
			if (codesResolver != null) {
				adapter.setMessageCodesResolver(codesResolver);
			}
			return new HandlerMethodValidator(adapter, modelAttributePredicate, requestParamPredicate);
		}
	}
	return null;
}

